import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import StudentList from "./views/StudentList";
import Navbar from "./components/Navbar";
import {Router, Routes, Route} from "react-router-dom";

function App() {
  return (
    <div className="App">

        <Navbar/>
      <StudentList/>
    </div>
  );
}

export default App;
